import axios from "axios";
const RESERVE_FACILITY_API_BASE_URL = "http://localhost:8080/votes";
class FacilityService {


    getVotes() {
        return axios.get(RESERVE_FACILITY_API_BASE_URL+"/findAll");
    }

}

export default new FacilityService();
